import "bootstrap/dist/css/bootstrap.min.css";
import logoGeo from "../assets/img/logo/geo-logo.svg";
function HeaderFDI() {
  return (
    <div>
      <div
        class="  d-flex flex-row justify-content-around pt-2 bg"
        style={{ backgroundColor: "#F5F6FF", height: " 100px" }}
      >
        <div class="col-4 d-flex justify-content-center align-items-center" >
          <div className="logo_cntaner">
          <img src={logoGeo} class="img-thumbnail" alt="..."/>
          </div>
        </div>
        <div class="col-4 d-flex justify-content-center align-items-center">პირდაპირი უცხოური ინვესტიციების პორტალი</div>
        <div class="col-4 d-flex justify-content-center align-items-center">3 of 3</div>
      </div>
    </div>
  );
}
export default HeaderFDI;
